【キャンメイク パーフェクトスタイリストアイズ 14 アンティークルビーの詳細】<br>
●繊細な粉質が、しっとりとまぶたに密着して色落ちを防ぎます。<br>
●透明感のあるキラうるトッピングジュエル（繊細ラメ）は、気分によってトッピング！ラメなしメイクもラメメイクも楽しめちゃう。涙袋メイクにもオススメ！ <br><br>

【ご注意】<br>
○お肌に異常が生じていないかよく注意して使用してください。<br>
○お肌に合わない時は、ご使用をおやめ下さい。<br><br>

【成分】<br>
スクワラン、リンゴ酸ジイソステアリル、メチルパラベン、ブチルパラベン、トコフェロール、グンジョウ、コンジョウ、シリカ、ステアリン酸亜鉛、タルク、マイカ、合成フルオロフロゴパイト、酸化スズ、酸化チタン、酸化鉄、水酸化AL、赤226、硫酸Ba<br><br>

【内容量】<br>
1個<br><br>

【販売元】<br>
井田ラボラトリーズ<br>
