【パルガントン スリーバイスリーキューブカラーズ SV60 スモーキー＆バイオレットの詳細】<br>●3色のキューブ状アイシャドウのラインが3列そろった9色のアイシャドウパレット。<br>●3パターンのアイメイクの他、気分に合わせて組み合わせを変えたり、混ぜ合わせて色を調節したりアイメイクの幅がひろがる大活躍のアイテムです。<br>●３×３キューブカラーズ。<br><br>【ご注意】<br>○傷・はれもの・湿疹・かぶれ・ただれ・色素異常などの症状がある部位にはお使いにならないでください。<br>○赤み・はれ・かゆみ・しげきなどの異常があらわれた場合は、ご使用をおやめください。皮膚科専門医へのご相談することをおすすめします。そのまま続けてお使いになりますと悪化させることがあります。<br>○目に入らないようにご注意ください。もし入った場合はすぐに水かぬるま湯で洗い流してください。<br>○使用後は、必ずケースの上フタをしめてください。<br>○乳幼児の手の届かないところにおいてください。<br>○高温や湿度の高いところ、直射日光をさけて保管してください。<br><br>【成分】<br>タルク、マイカ、ステアリン酸Mg、ジメチコン、トリ（カプリル酸/カプリン酸）グリセリル、フェノキシエタノール、カプリリルグリコール、ビスジグリセリルポリアシルアジペート－２、ステアロイルオキシステアリン酸オクチルドデシル、メチルパラベン、プロピルパラベン、アロエベラ葉エキス、酢酸トコフェロール、PET、酸化チタン、酸化鉄、グンジョウ、コンジョウ、マンガンバイオレット、カルミン<br><br>【内容量】<br>1個<br><br>【原産国】<br>中国<br><br>【販売元・製造元・輸入者名】<br>ドドジャパン<br>東京都台東区東上野2-13-2猪田ビル3Ｆ<br>03-3833-4071<br><br>【商品区分】<br>化粧品<br><br>［パルガントン アイシャドウ］<br><br><br><hr>広告文責：株式会社モリキ<br>電話：0269-38-0611<br><style type="text/css">
